            private static int _Index=0;
            /// <summary>
            /// Current Index in PSR-array
            /// </summary>
            public static int Index
            {
                get { return _Index; }
                set
                {
                    while (value < 0) value = value + 10000;
                    while (value >= 10000) value = value % 10000;
                    _Index = value;
                }
            }

            /// <summary>
            /// Retruns pseudo-random int-number in range [0-MaxValue]
            /// </summary>
            /// <param name="MaxValue"></param>
            /// <returns></returns>
            public static int Next(int MaxValue)
            {
                Index++;
                return (int)(RNDA[Index]*MaxValue);
            }

            /// <summary>
            /// Retruns pseudo-random double-number in range [0-MaxValue]
            /// </summary>
            /// <param name="MaxValue"></param>
            /// <returns></returns>
            public static double Next(double MaxValue)
            {
                Index++;
                return RNDA[Index] * MaxValue;
            }
